frames.customCss:
body {
font-family: Roboto Condensed Medium;
background-color: #000;
color: #fff;
}

img, video {
  filter: invert(1);
}

svg, [class*="icon"], [class*="Icon"], [class*="btn"], [class*="button"] {
  filter: invert(1);
}

a {
  color: #fff;
  border-bottom: 1px solid #fff;
}

